INSERT INTO `gpinternet` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '49 ', '1000', '1Gb video Pack', 'Terms & Conditions:  1GB Video for 5 Days at Tk 49 (Inclusive of SD+VAT+SC) Activate easily from MyGP app by downloading MyGP or use Activation Code : *121*3077# This Internet offer will run until further notice Offer applicable for all prepaid and postpaid customers including BS Pre & Post (BS prepaid and post customers will be able to take the offer through Dial code but will not be able to avail the offer through MyGP app). Customer can activate unlimited time during this offer period Unused Data Volume will be carried forward if the customer purchases the same pack(1GB Video at Tk 49) within the active validity period Dial *121*1*4# to know internet balance To Cancel your Internet Offer, dial *121*3041# Customers will be able to browse (http://m.youtube.com/ ; http://m.bongobd.com/ ; http://www.popcornlive.tv/) from mobile only using this special video pack offer If Video Internet Volume finishes before expiry date and there is no remaining internet volume in any other internet account, customers will be charged Tk 0.01/10KB (till validity exists, up to 244 Taka (Inclusive of SD+VAT+SC) While availing this special Video internet pack, if there is no remaining internet volume in any other internet account, customers will be charged Tk 0.01/10KB (till validity exists, up to 244 Taka (Inclusive of SD+VAT+SC) for any other internet usage(except http://m.youtube.com/ ; http://m.bongobd.com/ ; http://www.popcornlive.tv browsing ). Customer will not be able to browse mentioned sites through proxy based browsers. Customers can only use default web browser and apps');
INSERT INTO `gpinternet` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '337', '1500', '337 Takai 1.5 Gb', 'Terms & Conditions:  This package is applicable for all Grameenphone prepaid and postpaid customers. 1.5GB internet pack is valid for 28 days. Price is inclusive of SD, SC & VAT. To check remaining volume, customers need to dial *567#. To turn on Auto Renewal feature after package activation, SMS "ON" to 5000. After Internet Volume Expiration customers will be charged Tk 0.01/10KB till validity exists, up to 244 Taka (Inclusive of SD+VAT+SC). Validity includes the activation day. Unused Data Volume will be carried forward To Cancel your Internet package, dial *121*3041#');
INSERT INTO `gpinternet` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '29', '125', '29 Takai 125 Mb', 'Terms & Conditions:  125MB for 3 Days at Tk 29 (Inclusive of SD+VAT+SC), Activation Code : *121*3074# or Use MyGP app to buy the pack easily This Internet offer will run until further notice Offer applicable for all prepaid and postpaid customers including BS Pre & Post (BS prepaid and post customers will be able to take the offer through Dial code but will not be able to avail the offer through MyGP app). Customer can activate unlimited time during this offer period. After Internet Volume Expiration customers will be charged Tk .01/10KB (till validity exists, up to 244 Taka) Unused Data Volume will be carried forward if the customer purchases the same pack (125MB at Tk 29) within the active validity period Dial *121*1*4# to know internet balance To Cancel your Internet Offer, dial *121*3041#.');
INSERT INTO `gpinternet` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '34', '3000', 'GrameenPhone r notun sonjug', 'Offer Detail:  New Connections will be able to enjoy 5 Tk Preloaded Talktime, 50 GP-GP SMS and 50MB Internet free. Preloaded talktime for Village Phone will 50 Tk Validity of all the Preloaded bonus will be 30 days including disbursement date Free SMS and Internet will be disbursed within 72 hours of activation To check the pre-loaded talk time dial *566# and for bonus dial *121*1*2#. After consumption of Free volume quota within the validity period customer will be charged at BDT.01/10Kb, up to BDT 244 (Inclusive of SD+VAT+SC). Free Internet, Adha poisha & 1 poisha on First Recharge:  On 34 taka First Recharge, Customers will be able to enjoy 0.5 poisha/second call rate to any Grameenphone number and 1 poisha/second to any other local numbers 24 hours for 15 days. In addition to that, customers will get 512 MB Internet for 7 days. On 54 taka First recharge, customers will be able to enjoy 0.5 poisha/second call rate to any Grameenphone number and 1 poisha/second to any other local numbers 24 hours for 30 days. In addition to that, customers will get 1 GB Internet for 30 days. Upon expiry of special tariff, customers will be able to enjoy the main package call rate. While enjoying the special lower tariff others lower tariff will not be applicable, Lower tariff is not applicable on bonus amount, bonus minutes or Emergency Balance and these will consumer first. To check bonus, please dial *121*1*2# 512 MB on 9 Tk Recharge Trigger on 34 Tk First Recharge:  On 34 taka First Recharge, customers will be eligible to buy 512 MB Internet for only 9Tk (inclusive all charges). Customers need to recharge exact 9 Tk to get 512 MB with 7 days validity. Customers can avail 512 MB Internet for 9 Taka (inclusive all charges) offer only once in one calendar month. 512 MB Internet for 9 Tk (inclusive all charges) offer will be open for 5 consecutive months including the month of 34 taka first recharge. Each calendar month customers can take the offer once. Customers need to recharge exact 9 Tk to avail 512 MB Internet for 9 Tk offer each time. The validity period for the 512 MB Internet for 9 Taka (inclusive all charges) offer is 7 days. Subscribers can avail this offer maximum of 5 times within his eligible period. Five Calendar months will be started from the date from his 34Tk first recharge. Customers can check his monthly remaining opt-in quota by dialing *121*1111# This offer will be applicable only on 34 Tk First recharge done from 23th March and onwards during the campaign period. The first recharge offer is applicable only for the first time, after which the 34 Taka recharge offer and 54 Taka recharge offer will not be applicable for the subscriber. During the campaign period above mentioned recharge points (9 Taka, 34 Taka, 54 Taka) are only applicable to the eligible new subscribers and will remain restricted for all other customers. 5% Supplementary Duty (SD) + 15 % VAT inclusive of SD will be applicable for all charges + 1% surcharge on base tariff.');
INSERT INTO `gpinternet` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '40', '400', 'Joto Kotha Toto Internet', 'Achieve every days target and get  Bonus 1MB free internet on every 1 minute talk time used.  Only one target is applicable for each user Every user has to dial *999*2# to register to the campaign. Registration FREE The user will get a confirmation SMS after registration Registering once, during the campaign, is sufficient. Registration can be done any day while the campaign is running. The user will get bonus only after successful registration After fulfilling daily target after registration, the user will be eligible for the bonus To know the bonus amount and validity dial *566*48# Maximum bonus internet per call is 5MB. The accountable time to get bonus is till 11:59pm Everyday usage target includes local and international calls ( includes call times of 1 paisa offer, other various packs and voice bundles usages) Any call that starts in a day and ends in the next day will not be counted After fulfillment of target, get 1MB free for every 1 minute used all prepaid users except ERS, GPPP, VP, BPO, are eligible To know the target of each day see GP Bonus SMSs Registering once, during the campaign, is sufficient in order to get bonus Prepaid users who joined on October 31, 2016 or before, would be eligible for this campaign offer Users with incoming and outgoing activities in January 2017 would be eligible for this campaign offer To unregister dial *999*4# (would be activated with 72 hours) IVR minutes are not to be counted');
INSERT INTO `gpinternet` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '50', '500', 'What\'s App internet', 'Bangla WhatsApp is now available on Grameenphones largest and strongest 3G network.  To enjoy WhatsApp in Bangla, a customer needs to select Bangla in the language settings (settings > chats > app language > ?????) right in the WhatsApp app. It will work on the android play store WhatsApp version 2.17.65-onwards. Also, a customer can download WhatsApp on their mobile phone from https://www.whatsapp.com/android. Not available on iOS yet.');
