INSERT INTO `gpvoice` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '14', '40', 'Kotha beshi sobai Khosi', 'Terms & Conditions:  To avail this Talk Time offer, eligible customers (djuice, Smile, Bondhu, Amontron, Nishchinto, Ekota-1, Ekota-2, Ekota-3, Ekota-4, Business Solutions Prepaid 1,2,3,5, Shofol, GPPP and VP subscribers) will need to dial *121*4*4# Customer will get 40 GP- GP Minutes The validity of the Free Minutes will be 16 hours from the time of purchase At the end of the validity period, if a customer has any remaining minutes, it will be forfeited. However, if a customer re-purchases within the validity period, the minutes will be added and the higher validity will be given To check the remaining balance, customer need to dial *1000*2#. The minutes purchased can be used for any GP numbers The Price is inclusive of SD, VAT and SC');
INSERT INTO `gpvoice` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '99', '300', '99 Takai 300 minute', 'Terms & Conditions:  To avail this Talk Time offer, eligible customers (All Prepaid except I-Sim, Flexi Load SIM and BPO) will need to dial *111*300# or *121*4*6# Customer will get 300 GP- GP Minutes The validity of the Free Minutes will be 07 Days and can be used for 24 hrs of the day At the end of the validity period, if a customer has any remaining minutes, it will be forfeited. However, if a customer re-purchases within the validity period, the minutes will be added and the higher validity will be given Customers need to dial *121*1*2# to know the remaining minutes balance The minutes purchased can be used for any GP numbers The Price is inclusive of SD, VAT and SC');
INSERT INTO `gpvoice` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '53', '100', '53 Takai 100 minute', '100 GP  GP Minutes and 50 any net SMS at Tk 53  Terms & Conditions:  To avail this Talk Time offer, eligible customers will need to dial *111*100# Customer will get 100 GP- GP Minutes and 50 Any net SMS The validity of the Free Minutes will be 07 days usable 24 hrs of the day At the end of the validity period, if a customer has any remaining minutes, it will be forfeited. However, if a customer re-purchases within the validity period, the minutes will be added and the higher validity will be given Customers need to dial *121*1*2# to know the remaining minutes & SMS balance The minutes purchased can be used for any GP numbers The Price is inclusive of SD, VAT and SC');
INSERT INTO `gpvoice` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '24', '75', 'Title', '75 GP  GP Minutes at Tk  24\n\nTerms & Conditions:\n\nTo avail this Talk Time offer, eligible customers will need to dial *111*80# or *121*4*5#\nCustomer will get 75 GP- GP Minutes\nThe validity of the Free Minutes will be 24 hours from the time of purchase\nAt the end of the validity period, if a customer has any remaining minutes, it will be forfeited. However, if a customer re-purchases within the validity period, the minutes will be added and the higher validity will be given\nCustomers need to dial *1000*2# to know the remaining minutes balance\nThe minutes purchased can be used for any GP numbers\nThe Price is inclusive of SD, VAT and SC');
INSERT INTO `gpvoice` (`imagein`, `takain`, `megabyte`, `title`, `offerdescription`) VALUES
(, '29', '400', 'Adaha Poisha per second', 'All Grameenphone Pre-Paid customers (except ERS and BPO SIM) who are not using their connections since 28-FEB-2017 or before will be able to enjoy Adha Poisha/Sec to any GP Number (12:00 AM to 5:00PM) and 1 Poisha/sec to any other numbers (24 hours) and 1 SMS (GP-Any operator) for 30 days by recharging exact 29 taka.  Offer Detail:  The Campaign will run from 05  APR -2017 to until further notice All GP pre-paid subscribers (except ERS and BPO) who are not using their connections since 28-FEB-2017 or before will be able enjoy this offer. To check the offer eligibility send Apr 017XXXXXXXX to 9999 Unregistered customers and who are not using their connections since inception to 15-December-2014 is not eligible for this offer Adha poisha/Sec to any GP Number will be applicable from 12am-5pm Ek poisha/Sec to any other number will be applicable for 24 hours After 5:00PM (to 11:59 PM) GP-GP Calls also will be changed as 1p/sec All eligible subscribers will get the offer without any opt-in (Just need to recharge exact 29 taka) Validity of Lower tariff and SMS will be 30 days including the recharge date; Offer can be availed multiple times during the duration of the campaign. on multiple recharges, longer validity will prevail During the offer period, this special tariff (Adha poisha/sec and 1 poisha /sec (24 hours) call rate to any local number) will be applicable on regular package tariff, Super FnF, FnF and all recharge based lower tariff like (1 poisha offer). Special tariff is not applicable on Procured minutes, Bonus minutes, Bonus Amount and Emergency Balance. Procured minutes, Bonus minutes, Bonus Amount and Emergency Balance will be consumed first 5% Supplementary Duty (SD) + 15 % VAT inclusive of SD will be applicable for all charges + 1% surcharge on base tariff');

